import React from "react";

const Cards = ({ productos }) => {
  return (
    <div className="flexC">
      <div className="card"></div>

      {productos.map((x) => (
          <img alt={x.img} src={x.img}></img>
        ))}
    </div>
  );
};

export default Cards;
